INSERT INTO `ox3ry_content` VALUES (1, 37, 'Контакты', 0x6b6f6e74616b7479, '<p>{source}</p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    &lt;script src="//api-maps.yandex.ru/2.0/?load=package.standard,package.geoObjects,package.traffic&amp;lang=ru-RU" type="text/javascript"&gt;&lt;/script&gt;</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">&lt;script type="text/javascript"&gt;</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">var myMap;</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">var myGeoObject;</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">ymaps.ready(init);</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">function init () {</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    myMap = new ymaps.Map(''map'', {</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        center:[55.758962, 37.655485], // </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        zoom:16</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    });</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">   </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> myMap.balloon.open([55.75925, 37.654466], "Магазин &amp;#8220;ДУЭТ&amp;#8221;", {closeButton: false });</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> // Создаем ломаную с помощью вспомогательного класса Polyline.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    var myPolyline = new ymaps.Polyline([</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Указываем координаты вершин ломаной.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.75925, 37.654466],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.759430, 37.654760],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.75910, 37.655093],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.75917, 37.655525],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.758969, 37.655688],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.759312, 37.657397],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.758520, 37.657447],</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            [55.758520, 37.659146]</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        ], {</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Описываем свойства геообъекта.%2C</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Содержимое балуна.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            balloonContent: "Ломаная линия"</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        }, {</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Задаем опции геообъекта.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Отключаем кнопку закрытия балуна.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            balloonHasCloseButton:false,</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Цвет линии.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            strokeColor: "#913c2e",</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Ширина линии.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            strokeWidth: 4,</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Коэффициент прозрачности.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            strokeOpacity: 0.7</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        });</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    // Добавляем линии на карту.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    myMap.geoObjects</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        .add(myPolyline);</span></p>\r\n<p> </p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> myMap.controls</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">   .add(''zoomControl'', { left: 5, top: 5 })</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">   .add(''mapTools'', { left: 35, top: 5 })</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">   .add(new ymaps.control.MiniMap({type: ''yandex#publicMap'' }, { size: [250, 200] }));</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    var trafficControl = new ymaps.control.TrafficControl({</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Отображаются пробки "Сейчас".</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            providerKey: ''traffic#actual'',</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            // Начинаем сразу показывать пробки на карте.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">            shown: false</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">        });</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    // Добавим контрол на карту.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    myMap.controls.add(''trafficControl'',{ left: 150, top: 5 });</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    // Получим ссылку на провайдер пробок "Сейчас" и включим показ инфоточек.</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">    trafficControl.getProvider(''traffic#actual'').state.set(''infoLayerShown'', false);  </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> };</span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;"> </span></p>\r\n<p> </p>\r\n<p><span style="font-family: ''courier new'', courier, monospace;">&lt;/script&gt;</span></p>\r\n<p>{/source}</p>\r\n<h2>Вы можете посетить наш магазин по адресу: г. Москва, Яковоапостольский переулок, дом 11/13 стр. 4.</h2>\r\n<p><strong> Режим работы:</strong> понедельник - пятница с 10:00 до 20:00,<br />                            суббота - воскресенье с 10:00 до 18:00.</p>\r\n<h2> </h2>\r\n<p><strong>Тел</strong>. (495)917-87-18 , (495)917-44-24, (495) 917-84-80, (966) 121-50-61</p>\r\n<p>По вопросам опта обращаться по тел.(495) 917-44-24</p>\r\n<h2><strong>E-MAIL:</strong> danceduet@mail.ru</h2>\r\n<p><strong>Проезд:</strong> м. Курская (Арбатско-Покровская или Кольцевая линия). Выход на площадь Курского вокзала к улице Земляной Вал. По подземному переходу перейти на другую сторону Садового кольца, выход из перехода направо. Первый переулок налево - Яковоапостольский переулок. В доме № 15 войти в арку во двор. Наше здание - желтое 2-х этажное, за металлическим забором. Надо пройти слева от синей спортивной площадки вдоль металлического забора налево,  до калитки с вывеской "Дуэт". 8 минут от метро.</p>\r\n<div id="map" style="width: 700px; height: 600px;"> </div>', '', 1, 2, '2013-10-16 16:47:48', 953, '', '2015-06-18 20:19:51', 953, 0, '0000-00-00 00:00:00', '2013-10-16 16:47:48', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 94, 11, '', '', 1, 34086, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (2, 38, 'Главная', 0x676c61766e617961, '<h1>ДОБРО ПОЖАЛОВАТЬ В МАГАЗИН "ДУЭТ"!</h1>\r\n<p>Вы можете посетить наш магазин по адресу: г. Москва, Яковоапостольский переулок д 11/13 стр. 4.<br />С понедельника по пятницу с 10:00 до 20:00, в субботу и в воскресенье с 10:00 до 18:00.<br />Тел. (495) 917-87-18, (495) 917-44-24.<br />Схема проезда подробнее в <span style="text-decoration: underline;"><a href="index.php/kontakty">контактах</a>. </span></p>\r\n<h2> </h2>\r\n<h2>Грандиозная РАСПРОДАЖА!!!</h2>\r\n<p>Только у нас и только для Вас! Огромная скидка на отдельные модели <a href="index.php/obuv/la-zhenskaya/item/tantsmaster-1716-rasprodazha"><strong><span style="text-decoration: underline;">женской латины</span></strong></a> и <a href="index.php/obuv/st-zhenskij/item/tantsmaster-073-rasprodazha"><span style="text-decoration: underline;"><strong>женского стандарта</strong></span></a>. Торопитесь, количество ограничено!</p>\r\n<p> </p>\r\n<h2>Внимание, внимание!</h2>\r\n<p>В продажу поступили <a href="index.php/odezhda/kupalniki/item/kupalnik-bifleks"><span style="text-decoration: underline;"><strong>гимнастические купальники для выступлений</strong></span></a>!</p>\r\n<p>  </p>\r\n<h2>Теперь к оплате мы принимаем не только наличные, но и банковские карты!</h2>\r\n<p>А ещё у нас есть доставка. Все подробности можно узнать в разделе <span style="text-decoration: underline;"><a href="index.php/dostavka">доставка</a></span> и по тел. (495) 917-87-18, (495) 917-44-24, (495) 917-84-80, (966) 121-50-61</p>\r\n<p> </p>\r\n<h3><span style="font-size: 10px;"> </span><span style="font-size: 1.5em;">"ДУЭТ" официальный дилер обуви DanceMaster ("ТанцМастер") в Москве.</span></h3>\r\n<p>  </p>\r\n<h2>Модно - не значит дорого!</h2>\r\n<p>ВНИМАНИЕ ТАНЦОРОВ!!! "Дуэт" рад предложить Вам новые модeли мужской и женской обуви для <a href="index.php/obuv/argentinskoe-tango"><strong><span style="text-decoration: underline;">аргентинского танго</span></strong></a>.</p>\r\n<p>Во всем мире все большую популярность набирают светские балы: Императорский бал в Вене, бал Иоганна Штрауса, Венский оперный бал, Исторический костюмированный бал в Париже, Дрезденский бал. Наша страна не отстает от моды - Венский бал в Москве, Ежегодный бал-маскарад Игры Славы в Петербурге. Бальная обувь - важный атрибут таких мероприятий. Мы рады предложить вниманию дебютанток бальные туфли из натуральной кожи или сатина. Весь модельный ряд представлен в разделе "St женский". Для партнеров - лакированные туфли разных моделей из раздела "St мужской".</p>\r\n<p>Ищете где купить одежду для танцев!? Тренировочные платья для танцев La и St для взрослых, <strong><span style="text-decoration: underline;"> юбки La  </span></strong>, <a href="index.php/odezhda/rejting/item/platya-rejting?category_id=19"><span style="text-decoration: underline;"><strong>рейтинговые платья</strong></span></a>, <a href="index.php/odezhda/kolgoty-getry"><strong><span style="text-decoration: underline;">колготы</span></strong></a>, <a href="index.php/sumki-chekhly"><strong><span style="text-decoration: underline;">чехлы и портпледы</span></strong></a>. Компания &lt;Дуэт&gt; предлагает Вам прекрасное сочетание изысканного стиля и качества по самым доступным ценам в Москве. Наши профессиональные и очень доброжелательные консультанты станут Вашими спутниками в увлекательном путешествии по миру бального танца. Они всегда помогут Вам подобрать обувь для танцев: туфли для спортивных бальных танцев, кроссовки для джаз-модерна, балетки для хореографии. </p>\r\n<p>Создать яркий запоминающийся образ не только на турнире, но и на занятиях Вам поможет эксклюзивная линия тренировочной одежды для спортивных бальных танцев и хастла. Коллекции пополняются каждые два месяца, и теперь можно не беспокоиться, о том, что у кого-то будет такой же наряд, как у Вас. Экстравагантные и классические, озорные и строгие, элегантные и молодежные, - широкий ассортимент фасонов привлечет внимание даже самых привередливых модников. В магазине имеется большой выбор размеров, от 32 до 56, поэтому обладателям нестандартной фигуры подобрать костюм будет гораздо проще, чем раньше. </p>\r\n<p> </p>\r\n<h2>Хотите модный силуэт? Приходите к нам в "Дуэт"!</h2>\r\n<p> В магазине также представлена танцевальная обувь &lt;Танцмастер&gt;, и &lt;Соло +&gt;. Модели выполнены исключительно из натуральных материалов и отвечают всем медицинским требованиям. Это очень важно для танцоров, ведь в процессе изнурительных тренировок ни в коем случае нельзя нанести вред главному инструменту любого спортсмена - ногам. Изготовители бережно позаботились о Вашем комфорте, соединив в своей продукции современные технологии с изысканным дизайном. Демократичные цены Вас приятно удивят. Благодаря большому ассортименту, у нас можно подобрать удобные туфли, как для самых маленьких танцоров, так и для тех, кто уже выступает по самым высоким классам. В продаже также имеются специальные модели для "Сеньоров", они выполнены с учетом анатомических особенностей стопы этой категории танцоров. А так называемая "<a href="index.php/obuv/suvenirnaya"><strong><span style="text-decoration: underline;">сувенирная обувь</span></strong></a>" станет оригинальным подарком для всех влюбленных в бальный танец. </p>\r\n<p>Отдельным направлением работы нашей компании является мелкооптовая торговля. Договоритесь со своим партнером, друзьями, одноклубниками, и закажите сразу небольшую партию от десяти пар обуви! Вы всегда можете сделать заказ по телефону, факсу или электронной почте, а если туфли Вам не подойдут, то мы обязательно их обменяем. Для постоянных клиентов действует система скидок. </p>\r\n<p>Наши <a href="index.php/aksessuary"><span style="text-decoration: underline;"><strong>аксессуары</strong></span></a> придадут интеллигентную законченность Вашему имиджу на паркете и за его пределами. В "Дуэте" девушки всегда найдут все самое необходимое для звездного блеска на конкурсах: автозагары и автобронзаты самых известных фирм, косметические средства "KRYOLAN", незаменимые принадлежности для конкурсных причесок и т.д. Одним словом все, без чего не обходится ни одна современная партнерша. А молодые люди всегда могут приобрести в нашем салоне, как классические фрачные рубашки, так и модные боди, выполненные из стрейч-тканей, а также танцевальные брюки. Кроме того, у нас всегда можно купить абсолютно все английские фрачные принадлежности. А для хранения и перевозок Ваших танцевальных костюмов мы предлагаем чехлы и портпледы самых последних моделей по очень выгодным ценам. </p>\r\n<p>Особое место на наших витринах занимает продукция для самых юных танцоров. Рейтинговые платья для очаровательных принцесс, соответствующие всем конкурсным правилам, купальники для занятий хореографией, брюки и рубашки для мальчиков, - теперь родителям не стоит беспокоиться о поисках подходящих конкурсных костюмов для своих восходящих звездочек.</p>', '', 1, 2, '2013-10-17 05:48:44', 953, '', '2015-06-18 20:18:05', 953, 0, '0000-00-00 00:00:00', '2013-10-17 05:48:44', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 113, 10, 'бальные туфли, белые перчатки', '', 1, 268, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', '');
INSERT INTO `ox3ry_content` VALUES (3, 39, 'Партнеры', 0x706172746e657279, '<p>1. Компания <strong>"Танцмастер" (DANCEMASTER")</strong> - является крупнейшим производителем в России танцевальной обуви и одежды для занятий и выступлений, а также сопутствующих атрибутов. <br />http://dancemaster.su</p>\r\n<p>2. Фабрика по производству одежды и обуви для бальных танцев <strong>«СОЛО ПЛЮС»</strong> - это широко известная, хорошо зарекомендовавшая себя торговая марка.<br />http://solo-plus.ru</p>\r\n<p>3. <strong>ТПК "Танцующие"</strong> г. Ижевск - производитель одежды для  различных танцевальных направлений, художественной гимнастики, хореографии.<br />http://www.danceplus.ru</p>\r\n<p> </p>', '', 1, 2, '2013-10-19 05:23:06', 953, '', '2014-12-15 09:34:45', 953, 0, '0000-00-00 00:00:00', '2013-10-19 05:23:06', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 6, 9, '', '', 1, 5610, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (4, 40, 'Скидки, опт', 0x736b69646b692d6f7074, '<p>При единовременной покупке от 10 пар обуви при наличном расчете - скидка 10%.</p>\r\n<p>При постоянном сотрудничестве цены устанавливаются в индивидуальном порядке.</p>\r\n<p>Дилерский договор заключаем при гарантированном заказе от 50 пар обуви в месяц. В этом случае цена устанавливается в индивидуальном порядке.</p>\r\n<p>По вопросам опта обращаться по тел. 8 (495) 917-44-24 или по e-mail: danceduet@mail.ru</p>', '', 1, 2, '2013-10-19 05:25:11', 953, '', '2015-06-04 10:03:37', 953, 0, '0000-00-00 00:00:00', '2013-10-19 05:25:11', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 8, '', '', 1, 3938, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
