INSERT INTO `ox3ry_content` VALUES (8, 46, 'Доставка.', 0x646f737461766b61, '<h3>Доставка товара.</h3>\r\n<p>Уважаемые клиенты! Теперь Вы можете заказать нашу продукцию на дом или в офис!</p>\r\n<p>Наш курьер привезет вам на выбор несколько пар обуви или другой понравившейся продукции, которая представлена на нашем сайте. </p>\r\n<p>Вам необходимо позвонить в магазин и перечислить все необходимое по телефону: 8 (495) 917-87-18 или 8 (495) 917-44-24; или выбрать товар и прислать его название (цвет и размер) к нам на E-mail (для не срочных заказов, срок формирования увеличивается на 1 день).</p>\r\n<p>Наш специалист сформирует заказ и проинформирует Вас, когда товар будет доставлен. </p>\r\n<p>Так же в день доставки с вами свяжется курьер и предупредит о выезде по указанному вами адресу.</p>\r\n<p> </p>\r\n<h3>Доставка по Москве.</h3>\r\n<p>Стоимость доставки по Москве в пределах МКАД, в Митино и Жулебино - от 400 руб.</p>\r\n<p>Срочная доставка в день заказа по Москве: от 500 руб.</p>\r\n<p><strong>Примечания:</strong></p>\r\n<ul>\r\n<li>Время ожидания курьера пока осуществляется примерка товара составляет 15 мин.</li>\r\n<li>Курьер имеет право взять залог, в размере полной стоимости заказа, на время примерки.</li>\r\n<li>В случае отказа от товара, клиент обязан оплатить стоимость доставки.</li>\r\n</ul>\r\n<p><strong>Сроки доставки товара: </strong></p>\r\n<p>Комплектация и доставка товара происходит в течении 1-3 дней, с момента поступления заказа. Доставка по Москве осуществляется с 10 до 21 часа, пять дней в неделю (пн-пт), по предварительной договоренности с курьером. </p>\r\n<p>Во всех остальных случаях доставка и ее стоимость обсуждается отдельно по телефону.</p>\r\n<p><strong>Отказ от доставки: </strong></p>\r\n<p>Отказаться от покупки можно в любой момент до выезда курьера к вам - по телефону  8(495)917-87-18. В случае отказа от покупки в более поздние сроки, необходимо будет оплатить стоимость доставки. </p>\r\n<p><strong>Услуга выбора: </strong></p>\r\n<p>На выбор доставляется не более трех позиций из каждой категории товаров. Услуга выбора оплачивается дополнительно к стоимости доставки товара и составляет 50 руб. за каждую дополнительную единицу товара.</p>\r\n<p><strong>Возврат и обмен товара <span style="text-decoration: underline;"><a href="index.php/obmen-i-vozvrata-tovara">(подробнее)</a></span>:</strong></p>\r\n<p>Обмен и возврат товара производится в течении 14 дней с момента продажи, при предъявлении документа , удостоверяющего личность, в магазине «Дуэт» по адресу г. Москва, Яковоапостольский пер., д. 11/13 стр.4, в том случае, если товар не был в употреблении, сохранены упаковка, товарный вид, потребительские свойства, пломбы, фабричные ярлыки, а также чек. </p>\r\n<p><span style="text-decoration: underline;"><a href="index.php/obmen-i-vozvrata-tovara">Перечень непродовольственных товаров</a></span> надлежащего качества, не подлежащих возврату или обмену на аналогичный товар других размера, формы, габарита, фасона, расцветки или комплектации. Товары из данного перечня на обмен и возврат не принимаются.</p>\r\n<p> </p>\r\n<h3>Доставка товара в регионы России.</h3>\r\n<p>При отправке товара в регионы России, стоимость доставки зависит от способа доставки, веса отправляемого товара и удаленности населенного пункта. </p>\r\n<p>Сроки доставки в регионы существенно зависят от выбранного способа доставки и удаленности населенного пункта, и составляют от 3 дней до 4 недель. </p>\r\n<p>Товар отправляется транспортно-экспедиционной компанией, доставляющей заказы в предельно короткие сроки по удобному для Вас адресу. Заказ высылается после получения оплаты. </p>\r\n<p>Рассмотрим любые предложения по способу доставки товара и выберем наиболее удобный для Вас. </p>\r\n<p> </p>\r\n<p><strong>Мы будем всегда рады Вам помочь.</strong><br /><strong>Звоните, обращайтесь к нам,</strong><br /><strong>отдел продаж магазина "Дуэт". </strong></p>\r\n<p> </p>', '', 1, 2, '2014-03-04 11:53:25', 953, '', '2015-06-04 09:37:09', 953, 0, '0000-00-00 00:00:00', '2014-03-04 11:53:25', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 19, 4, '', '', 1, 8649, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (9, 47, 'Обмен и возврата товара', 0x6f626d656e2d692d766f7a76726174612d746f76617261, '<h3>Правила обмена и возврата товара</h3>\r\n<p>Обмен и возврат товара производится в течении 14 дней с момента продажи, при предъявлении документа , удостоверяющего личность, в магазине «Дуэт» по адресу г. Москва, Яковоапостольский пер., д.11/13, стр.4 в том случае, если товар не был в употреблении, сохранены упаковка, товарный вид, потребительские свойства, пломбы, фабричные ярлыки, а также чек. </p>\r\n<p>ПЕРЕЧЕНЬ непродовольственных товаров надлежащего качества, НЕ подлежащих возврату или обмену на аналогичный товар других размера, формы, габарита, фасона, расцветки или комплектации:</p>\r\n<p>(в ред. Постановлений Правительства РФ от 20.10.1998 № 1222, от 06.02.2002 № 81)</p>\r\n<ul>\r\n<li>Товары для профилактики и лечения заболеваний в домашних условиях (предметы санитарии и гигиены из металла, резины, текстиля и других материалов, инструменты, приборы и аппаратура медицинские, средства гигиены полости рта, линзы очковые, предметы по уходу за детьми), лекарственные препараты. </li>\r\n<li>Предметы личной гигиены (зубные щетки, расчески, заколки, бигуди для волос, парики, шиньоны и другие аналогичные товары).</li>\r\n<li>Парфюмерно-косметические товары.</li>\r\n<li>Текстильные товары (хлопчатобумажные, льняные, шелковые, шерстяные и синтетические ткани, товары из нетканых материалов типа тканей - ленты, тесьма, кружево и другие); кабельная продукция (провода, шнуры, кабели); строительные и отделочные материалы (линолеум, пленка, ковровые покрытия и другие) и другие товары, отпускаемые на метраж.</li>\r\n<li>Швейные и трикотажные изделия (изделия швейные и трикотажные бельевые, изделия чулочно-носочные).</li>\r\n<li>Изделия и материалы, контактирующие с пищевыми продуктами, из полимерных материалов, в том числе для разового использования (посуда и принадлежности столовые и кухонные, емкости и упаковочные материалы для хранения и транспортирования пищевых продуктов).</li>\r\n<li>Товары бытовой химии, пестициды и агрохимикаты.</li>\r\n<li>Мебель бытовая (мебельные гарнитуры и комплекты).</li>\r\n<li>Изделия из драгоценных металлов, с драгоценными камнями, из драгоценных металлов со вставками из полудрагоценных и синтетических камней, ограненные драгоценные камни.</li>\r\n<li>Автомобили и мотовелотовары, прицепы и номерные агрегаты к ним; мобильные средства малой механизации сельскохозяйственных работ; прогулочные суда и иные плавсредства бытового назначения.</li>\r\n<li>Технически сложные товары бытового назначения, на которые установлены гарантийные сроки (станки металлорежущие и деревообрабатывающие бытовые; электробытовые машины и приборы; бытовая радиоэлектронная аппаратура; бытовая вычислительная и множительная техника; фото- и киноаппаратура; телефонные аппараты и факсимильная аппаратура; электромузыкальные инструменты; игрушки электронные, бытовое газовое оборудование и устройства).</li>\r\n<li>Гражданское оружие, основные части гражданского и служебного огнестрельного оружия, патроны к нему.</li>\r\n<li>Животные и растения.</li>\r\n<li>Непериодические издания (книги, брошюры, альбомы, картографические и нотные издания, листовые изоиздания, календари, буклеты, издания, воспроизведенные на технических носителях информации). </li>\r\n</ul>\r\n<p>Источник информации:  <a href="http://ozpp.ru/">Общество защиты прав потребителей. </a> </p>\r\n<p>Товары из данного перечня на обмен и возврат не принимаются.</p>', '', 1, 2, '2014-03-22 15:30:27', 953, '', '2014-12-15 09:44:28', 953, 0, '0000-00-00 00:00:00', '2014-03-22 15:30:27', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 3, '', '', 1, 3447, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (10, 48, 'Каталог', 0x6b6174616c6f67, '<p><a href="index.php/katalog/obuv">Обувь</a></p>\r\n<p><a href="index.php/katalog/odezhda">Одежда</a></p>\r\n<p><a href="index.php/katalog/sumki-chekhly">Сумки, чехлы</a></p>\r\n<p><a href="index.php/katalog/aksessuary">Аксессуары</a></p>\r\n<p><a href="index.php/katalog/razmery">Размеры</a></p>', '', 1, 2, '2014-03-23 07:48:37', 953, '', '2014-03-23 07:58:14', 953, 0, '0000-00-00 00:00:00', '2014-03-23 07:48:37', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 2, '', '', 1, 336, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (11, 49, 'Выбор танцевальной обуви', 0x7679626f722d74616e74736576616c6e6f6a2d6f62757669, '', '\r\n<p><strong><span style="font-family: Times New Roman; font-size: medium;"> Выбор танцевальной обуви</span></strong></p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><span style="mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;"><span style="font-size: medium;"><span style="font-family: Calibri;">Самба, румба, ча-ча-ча, вальс, хастл, народные... Сколько разных танцев!<span style="mso-spacerun: yes;">  </span>Объединяет их одно - необходимость правильно подобрать обувь для танцев, соответствующую выбранному стилю. <span style="mso-spacerun: yes;"> </span></span></span></span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">Модели обуви для танцев отличаются не только внешним видом, но и типом колодки, высотой каблука. Неправильный выбор танцевальной обуви сделает занятия танцами крайне некомфортными для Вас.<span style="mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;"> Ведь для</span> каждого вида танцев существует своя форма колодки и каблука, своя степень жесткости.</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">Основные виды танцевальной обуви:</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;"><a href="index.php/obuv/baletki" target="_blank"><span style="text-decoration: underline;">балетки</span>, полупальцы, пуанты, <span style="text-decoration: underline;">чешки</span></a><span style="text-decoration: underline;">;</span></span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;"><a href="index.php/obuv/dzhazovki" target="_blank">джазовки</a>;</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">обувь для <span style="text-decoration: underline;"><a href="index.php/obuv/step" target="_blank">степа</a></span></span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">обувь для <a href="index.php/obuv/narodnaya" target="_blank"><span style="text-decoration: underline;">народных танцев</span></a> (туфли, сапожки, полусапожки);</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">обувь для бальных танцев (<a href="index.php/obuv/st-zhenskij" target="_blank"></a><span style="text-decoration: underline;"><a href="index.php/obuv/st-zhenskij" target="_blank">стандарт</a></span><a href="index.php/obuv/st-zhenskij" target="_blank"></a>);</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">обувь для латиноамериканских танцев (<span style="text-decoration: underline;"><a href="index.php/obuv/la-zhenskaya" target="_blank">латина</a></span><a href="index.php/obuv/la-zhenskaya" target="_blank"></a>);</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">обувь для стрип-пластики (<a href="index.php/obuv/shou"><span style="text-decoration: underline;">шоу</span></a>).</span></p>\r\n<p><span style="font-family: Calibri; font-size: medium;">Желательно посоветоваться с тренером, ведь выбор танцевальных туфель связан с решением большого количества вроде бы маленьких, но таких важных задач.</span></p>\r\n<p><span style="font-family: Calibri;"><span style="font-size: medium;"><span style="mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;">Поскольку при изготовлении</span></span><span style="line-height: 115%; font-size: 12pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-fareast-font-family: ''Times New Roman'';">обуви для танцев используются эластичные материалы, она должна быть подобрана как можно плотнее, с учетом того, что в процессе носки обувь принимает форму стопы.</span></span></p>\r\n<p> </p>', 1, 10, '2015-05-11 18:35:15', 953, '', '2015-05-18 02:45:21', 953, 953, '2015-06-06 20:15:46', '2015-05-11 18:44:09', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 1, 'бальная обувь, обувь для танцев, латина, стандарт', 'выбор обуви для танцев', 1, 466, '{"robots":"index, follow","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (12, 51, 'Аксессуары для танцевальной обуви', 0x616b73657373756172792d646c79612d74616e74736576616c6e6f6a2d6f62757669, '<p><strong><span style="font-size: medium;"><span style="font-family: Calibri;"><span style="text-decoration: underline;">Необходимые аксессуары для танцевальной обуви:</span></span></span></strong></p>\r\n<p> </p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><span style="font-family: Calibri;"><span style="font-size: medium;"><a href="index.php/obuv/aksessuary-dlya-obuvi/item/42-copy"><span style="text-decoration: underline;"><strong><span style="mso-bidi-font-style: italic;">Накаблучники</span></strong></span></a><strong><span style="mso-bidi-font-style: italic;">.</span></strong> Предохраняют набойки Ваших туфель от преждевременного стирания. Изготавливаются из силикона, обычно прозрачного. Подбираются в соответствии с типом каблука на танцевальной обуви.</span></span></p>\r\n<p> </p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><span style="font-size: medium;"><span style="font-family: Calibri;"><strong><span style="mso-bidi-font-style: italic;"><a href="index.php/obuv/aksessuary-dlya-obuvi/item/42"><span style="text-decoration: underline;">Щетка для чистки подошвы</span> </a>танцевальной обуви<em>.</em></span></strong> Во время тренировок подошва танцевальной обуви пачкается и становится гладкой. Специальная щетка <span style="mso-spacerun: yes;"> </span>помогает восстановить ворсистость подошвы танцевальной обуви для лучшего сцепления с паркетом, чем значительно снижает риск получения травм.</span></span></p>\r\n<p> </p>', '', 1, 10, '2015-05-19 10:42:03', 953, '', '2015-05-19 10:48:30', 953, 953, '2015-06-06 20:07:58', '2015-05-19 10:42:03', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, '', '', 1, 267, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (13, 52, 'Полезные советы', 0x706f6c657a6e79652d736f76657479, '<h1><strong><span style="text-decoration: underline;"><a href="index.php?option=com_content&amp;view=article&amp;id=11&amp;catid=10&amp;Itemid=146">Выбор танцевальной обуви</a></span></strong></h1>\r\n<h1> </h1>\r\n<h1><span style="text-decoration: underline;"><strong><a href="index.php?option=com_content&amp;view=article&amp;id=12&amp;catid=10&amp;Itemid=149">Аксессуары для танцевальной обуви</a></strong></span></h1>\r\n<h1> </h1>\r\n<h1><span style="text-decoration: underline;"><a href="index.php?option=com_content&amp;view=article&amp;id=14&amp;catid=2&amp;Itemid=101">Хастл, бачата, WCS</a></span></h1>', '', 1, 2, '2015-06-06 20:04:53', 953, '', '2015-06-11 18:17:40', 953, 0, '0000-00-00 00:00:00', '2015-06-06 20:04:53', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 11, 1, '', '', 1, 699, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `ox3ry_content` VALUES (14, 53, 'Хастл, бачата, WCS', 0x6b686173746c2d626163686174612d776373, '<p><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Хастл, сальса, бачата, свинг - танцы, в которых преобладают элементы латины, но в то же время каждый имеет свои отличительные черты. Так же как и стиль и уровень танцевания каждой пары. Поэтому для этих танцев выбор обуви очень широк.</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Для партнерш в первую очередь мы рекомендуем </span><a href="index.php/obuv/la-zhenskaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">La женскую</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> и </span><a href="index.php/obuv/trenirovochnaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">Тренировочную</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> , а так же хорошо подходят босоножки на широком и невысоком, а от этого - очень устойчивом, каблуке из раздела </span><a href="index.php/obuv/detskaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">La детская</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> .</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Для начинающих партнеров лучше подойдёт </span><a href="index.php/obuv/st-muzhskaya"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>St мужской</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> на невысоком каблуке, а для уверенно танцующих - </span><a href="index.php/obuv/la-muzhskaya"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>La мужская</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">.</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Так же для обоих партнеров хорошо подходят для занятий в зале мягкие джазовки и Джаз-модерн-кроссовки, а для открытых площадок - Джаз-кроссовки из раздела </span><a href="index.php/obuv/dzhazovki"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>Джаз</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> .</span></p>\r\n<div class="box-b1"> </div>', '', 1, 2, '2015-06-11 18:16:18', 953, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2015-06-11 18:16:18', '0000-00-00 00:00:00', '', '', '{"show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 373, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
