INSERT INTO `ox3ry_zoo_category` VALUES (11, 2, 'Хастл, бачата, WCS', 'khastl', '<p><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Хастл, сальса, бачата, свинг - танцы, в которых преобладают элементы латины, но в то же время каждый имеет свои отличительные черты. Так же как и стиль и уровень танцевания  каждой пары. Поэтому для этих танцев выбор обуви очень широк.</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Для партнерш в первую очередь мы рекомендуем </span><a href="index.php/obuv/la-zhenskaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">La женскую</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> и </span><a href="index.php/obuv/trenirovochnaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">Тренировочную</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> , а так же хорошо подходят босоножки на широком и невысоком, а от этого - очень устойчивом, каблуке из раздела </span><a href="index.php/obuv/detskaya"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"><span style="text-decoration: underline;">La детская</span></strong></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> .</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Для начинающих партнеров лучше подойдёт </span><a href="index.php/obuv/st-muzhskaya"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>St мужской</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> на невысоком каблуке, а для уверенно танцующих - </span><a href="index.php/obuv/la-muzhskaya"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>La мужская</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">.</span><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;">Так же для обоих партнеров хорошо подходят для занятий в зале мягкие джазовки и Джаз-модерн-кроссовки, а для открытых площадок - Джаз-кроссовки из раздела </span><a href="index.php/obuv/dzhazovki"><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;"><strong>Джаз</strong></span></a><span style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"> .</span></p>', 0, 23, 1, ' {\n	"content.teaser_description": "",\n	"content.teaser_image": "",\n	"content.teaser_image_width": "",\n	"content.teaser_image_height": "",\n	"content.image": "",\n	"content.image_width": "",\n	"content.image_height": "",\n	"content.categories_title": "",\n	"content.items_title": "",\n	"metadata.title": "",\n	"metadata.description": "",\n	"metadata.keywords": "",\n	"metadata.robots": "",\n	"metadata.author": ""\n}');
