nity manager de Pampers. Gr?ce aux m?dias sociaux, on touche les gens l? o? ils sont?, explique-t-on chez Procter?&?Gamble. Pour l’entreprise, ?le retour sur investissement se calcule en termes de volume des conversations g?n?r?es et du taux d’engagement vers la marque, lik?e, retweet?e, partag?e?,pr?cise Gr?goire Audidier, directeur des strat?gies de l’agence de communication num?rique Isobar.?Dans sa relation avec les marques, le client d?sire une reconnaissance de sa fid?lit? : obtenir des r?ductions, des invitations VIP, gagner des jeux-concours. Mais dans "reconnaissance" il y a le mot "reconna?tre". Alors on manipule des donn?es pour mieux cibler les clients, cr?er de la satisfaction et de l’engagement?, confie Sylvain Bellier, directeur du p?le marketing service de l’agence de ?CRM? (gestion de la relation clients) Soft Computing. Certains socionautes tr?s actifs, ?les ambassadeurs?, sont de pr?cieux leaders d’opinion identifi?s par un code technique.\r\n lisseur babyliss', 0);
