INSERT INTO `ox3ry_zoo_comment` VALUES (648, 0, 142, '', '', 'burberry homme', 'swodvggxphi@gmail.com', 'http://www.danone90ans.fr/echarpe-burberry-brit-soldes-femme-burberry-homme-chemise-pas-cher/', '36.248.187.57, 36.248.187.57', '2014-07-30 17:00:30', 'A l’?chelle de la plan?te, les statistiques sur les leaders des m?dias sociaux sont ?difiantes : 1,2?milliard d’utilisateurs actifs mensuels sur Facebook (26?millions en France), de 230?millions ? plus de 300 millions sur Twitter et Google +, sans parler des r?seaux d’?changes de photos et vid?os dont l’affluence grandissante a su s?duire les marques du luxe et de la mode : YouTube, Instagram, Vine, Snapchat ou Pinterest. Un trafic rentable pour les plateformes et une manne extraordinaire pour les grandes marques. ?On ne con?oit plus de communication sans pr?sence sur les m?dias sociaux. En mati?re de relations clients et de programme de fid?lit?, ils sont un pilier incontournable?, affirme David Gompel, directeur g?n?ral de Publicis Modem. Grande distribution, sport, tourisme, automobile, transport… Tous acteurs du num?rique ! Pour g?rer leur image, comme le fait la SNCF sur Twitter, ou pour doper les ventes. Un tweet d’Oprah Winfrey au sujet de la friteuse Actifry et l’action de Seb grimpe de 4%. Le r?seau ? l’oiseau bleu est ?galement appr?ci? pour son interface : ?Parfois, les voyageurs sont mieux inform?s des raisons d’un retard de train que le chauffeur lui-m?me !? s’amuse Christine Balagu?, vice-pr?sidente du Conseil national du num?rique et titulaire de la chaire R?seaux sociaux de T?l?com ?cole de management qui forme des dirigeants web friendly.?Les ambassadeurs?, ces pr?cieux leaders d’opinionDe leur c?t?, satur?s de pubs jug?es trop intrusives, les internautes sont cependant pr?ts ? engager la conversation sur leur r?seau social avec des marques qu’ils ont d?lib?r?ment choisies et dont ils attendent en retour plus d’intimit?, d’interactivit?, voire d’exclusivit? : ?C’est un ?change interpersonnel que la?m?re de famille va rechercher en parlant soins du b?b? avec le community manager de Pampers. Gr?ce aux m?dias sociaux, on touche les gens l? o? ils sont?, explique-t-on chez Procter?&?Gamble. Pour l’entreprise, ?le retour sur investissement se calcule en termes de volume des conversations g?n?r?es et du taux d’engagement vers la marque, lik?e, retweet?e, partag?e?,pr?cise Gr?goire Audidier, directeur des strat?gies de l’agence de communication num?rique Isobar.?Dans sa relation avec les marques, le client d?sire une reconnaissance de sa fid?lit? : obtenir des r?ductions, des invitations VIP, gagner des jeux-concours. Mais dans "reconnaissance" il y a le mot "reconna?tre". Alors on manipule des donn?es pour mieux cibler les clients, cr?er de la satisfaction et de l’engagement?, confie Sylvain Bellier, directeur du p?le marketing service de l’agence de ?CRM? (gestion de la relation clients) Soft Computing. Certains socionautes tr?s actifs, ?les ambassadeurs?, sont de pr?cieux leaders d’opinion identifi?s par un code technique.\r\n burberry homme', 0);
