INSERT INTO `ox3ry_zoo_comment` VALUES (675, 0, 142, '', '', 'curl secret babyliss', 'wlaopdhom@gmail.com', 'http://babyliss-curl-secret.moonfruit.fr/', '58.22.70.124, 58.22.70.124', '2014-09-07 08:31:10', 'Le lac ass?ch? d’Ivanpah, dans le d?sert californien de Mojave, scintille de 173 500?miroirs. Plant?s dans le sol en cercles concentriques sur 14?kilom?tres carr?s, les h?liostats r?fl?chissent la lumi?re du soleil vers des chauffe-eau de 2 000?tonnes perch?s au sommet de trois tours culminant ? 140?m?tres. La vapeur d’eau entra?ne des turbines d’une capacit? de 392?m?gawatts, soit de quoi alimenter 140 000?foyers. Il s’agit de la plus grande centrale solaire thermodynamique au monde, inaugur?e ce mois-ci, apr?s quatre ans de travaux. Selon les estimations, la centrale d’Ivanpah devrait permettre ? l’?conomie am?ricaine d’?viter l’?mission de 13,5?millions de tonnes de gaz ? effet de serre sur trente?ans. Soit la pollution produite par 2?millions de voitures sur la p?riode. En outre, elle jouit de la r?putation de Google en mati?re d’innovation, qui y a investi 168?millions de dollars (122?millions d’euros). De leur c?t?, les gros distributeurs d’?lectricit? de Californie se sont engag?s ? ?tre clients d’Ivanpah, conform?ment ? leur mandat de se procurer 30% de leur ?nergie de sources renouvelables d’ici ??2020.\r\n curl secret babyliss', 0);
